import React from 'react';
import logo from './mlogo.png';
import * as Styled from './styled';

function App() {
  return (
    <div>
      <Styled.Header height="200px">
        <Styled.Logo src={logo} alt="Marvel logo" />
        <form>
          <Styled.Label>Search for someone in the Marvel Universe: </Styled.Label>
          <Styled.Input type="text" id="search" required placeholder="Iron Man"></Styled.Input>
        </form>
      </Styled.Header>
    </div>
  );
}

export default App;
